INSERT INTO `cc_notifications` VALUES (6,'Rules','<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">1. There will be two rounds in the competition. The first round will be held on 28th January, 2014 </span></p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">from 6pm to 8pm. The second round will be held on 30th January, 2014.</span></p>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">2. Scoring will be cumulative over both rounds.</span></p>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">3. Round one will have three problems -- one easy problem, one problem of medium difficulty level, and one hard problem.</span></p>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">4. There will be no submission penalty for a wrong submission.</span></p>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">5. In case a problem is partially solved, i.e if the code passes some test cases but fails the others, partial scoring will be taken into account. Each test case/file will have equal weightage.</span></p>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">6. Languages supported are C, C++, Java and Python (2 and 3).</span></p>\n<p><span style=\"background-color: transparent; font-family: Calibri; font-size: 15px; white-space: pre-wrap; line-height: 1.15;\">7. Winner will be decided based on the cumulative scores over two rounds. Tie break will be done on the basis of earlier submission.</span></p>\n<p><span style=\"background-color: transparent; font-family: Calibri; font-size: 15px; white-space: pre-wrap; line-height: 1.15;\">8. The last submitted solution to any problem will be regarded as the final submission by default. To change this, please mark the appropriate submission as your final submission from your &ldquo;All Submissions&rdquo; tab.</span></p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Calibri; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">9. Please do not copy code from anywhere. Plagiarism detectors are enabled and the Codecracker team reserves the right to disqualify contestants suspected to be using unfair means.</span><span style=\"background-color: transparent; font-family: Calibri; font-size: 15px; white-space: pre-wrap; line-height: 1.15;\">10. The Codecracker team reserves the right to change these rules at any time without any prior notice. In the event of any changes being made, the updated set of rules will be posted here on this website with immediate effect. Please check the latest information in order to inform yourself of any changes.</span></p>\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>','2014-01-28 17:47:52'),(7,'Please Check \"Round ONE\" from Rounds to be able to view the problems!','','2014-01-28 18:40:07'),(8,'The contest has been extended by an hour. It ends at 9:00 PM IST now.','','2014-01-28 18:57:25'),(9,'National Word Rejudged','<p>Solutions for the National Word Problem have been rejudged. We aplogize for the inconvenience.</p>','2014-01-28 19:00:28');
