INSERT INTO `cc_problems` VALUES (4,1,'Roshan Bhai','<p>Roshan likes to play with numbers a lot, given a sequence of numbers he was keen in finding the longest \"Crooked sub-sequence\".</p>\n<p>A sequence is Crooked if the difference between consequtive numbers alternate between positive and negative.</p>\n<p>Example : 2,10,3,5,4 is a Crooked sequence, because the differences (8,-7,2,-1) are alternatively positive and negative.</p>\n<p>&nbsp;</p>\n<p>Given a sequence of integers return the length of the longest sub-sequence of sequence that is a crooked sequence.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Input format:&nbsp;</p>\n<p>First line will be the number of testcases N, the following N lines will contain N sequences.</p>\n<p>&nbsp;</p>\n<p>Output format:&nbsp;</p>\n<p>N lines printing the length of each longest Crooked sub-sequence</p>\n<p>&nbsp;</p>\n<p>Example :&nbsp;</p>\n<p>Input</p>\n<p>4</p>\n<p>1 7 4 9 2 5</p>\n<p>1 17 5 10 13 5 10 5 16 8</p>\n<p>44</p>\n<p>1 2</p>\n<p>&nbsp;</p>\n<p>Output</p>\n<p>6</p>\n<p>7</p>\n<p>1</p>\n<p>2</p>\n<p>&nbsp;</p>',100,0,2000,8000,6000,50000,'C,C++,Python 2,Python 3,Java','diff','-bB'),(4,2,'Debayan Linux','<p>Debayan is very fond of Linux and likes Linux Words a lot. A Linux Word is a word that consists of only the letters L, I, N, U, and X in that exact relative order. There must be exactly one L, exactly one I, one or more Ns, exactly one U and exactly one X. Case does not matter. For example, \"Linux\", \"Linnnux\" are linux words, whereas \"Llinux\", \"Linuxx\" are not.</p>\n<p>&nbsp;</p>\n<p>You are given a String word which you must turn into a Linux Word. For each character in word, you can either replace it with a different letter or leave it unchanged. No other operations, like inserting new characters or deleting existing characters, are allowed. Printing the minimal number of characters you must replace to get a Linux Word. If it\'s impossible, return -1.</p>\n<p>&nbsp;</p>\n<p>Input format:&nbsp;</p>\n<p>First line will be the number of testcases N, the following N lines will contain N words without any space.</p>\n<p>&nbsp;</p>\n<p>Output format:&nbsp;</p>\n<p>N lines printing the desired output.</p>\n<p>&nbsp;</p>\n<p>Constraints:</p>\n<p>Example :</p>\n<p>N&lt;100</p>\n<p>length of each input string &lt; 100</p>\n<p>&nbsp;</p>\n<p>Input</p>\n<p>4</p>\n<p>Linux</p>\n<p>LinnnnnUx</p>\n<p>Lnux</p>\n<p>Codecracker</p>\n<p>&nbsp;</p>\n<p>Output</p>\n<p>0</p>\n<p>0</p>\n<p>-1</p>\n<p>11</p>\n<p>&nbsp;</p>',80,0,500,2000,1500,50000,'C,C++,Python 2,Python 3,Java','diff','-bB'),(4,3,'Dice Game','<p>Swapnil discovered a new dice game, where five dices are used. Your task is to calculate the score in the first phase of Swapnil\'s game. The score is determined by the values on the upward die faces after a roll. Then the player chooses a value, and all the dice showing those values are considered active. The score is simply the summation of the values on active dice.</p>\n<p>&nbsp;</p>\n<p>For example, the player rolls the 5 dices and gets the values 2,2,3,5 and 4. Choosing the value 2 makes the dice showing 2 active and yields a score of 2 + 2 = 4, while choosing 5 makes the one die showing 5 active, yielding a score of 5.</p>\n<p>&nbsp;</p>\n<p>Given the values of the 5 dices after they are rolled, print the maximal possible score with these values.</p>\n<p>&nbsp;</p>\n<p>Input Format</p>\n<p>First line will be the number of testcases N, the following N lines will contain 5 numbers between 1 and 6.</p>\n<p>&nbsp;</p>\n<p>Output format:&nbsp;</p>\n<p>N lines printing the maximal score.</p>\n<p>&nbsp;</p>\n<p>Example</p>\n<p>Input :</p>\n<p>3</p>\n<p>2 2 3 4 5</p>\n<p>1 6 4 1 3</p>\n<p>5 3 3 3 5</p>\n<p>&nbsp;</p>\n<p>Output :&nbsp;</p>\n<p>5</p>\n<p>6</p>\n<p>10</p>',100,0,500,2000,1500,50000,'C,C++,Python 2,Python 3,Java','diff','-bB'),(4,4,'Existence','<p>The year is 4139 A.D. Humanity now resides in a planet named Kainan. So far there exists K settlements, some of them connected with one-way channels.</p>\n<p>&nbsp;</p>\n<p>The Chancellor of Kainan has decided to establish SWAT in his planet. The cost of building a SWAT station in each settlement is given. However, there may not be a need to build the same in every settlement. The only requirement is that every settlement must be reachable from some station using channels.</p>\n<p>&nbsp;</p>\n<p>As the next elections are approaching, the chancellor doesn\'t want to expose large SWAT expenses. Thus he wants the average cost of a built station to be as low as possible.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>INPUT: T, the number of test cases. Each test cases begins with K, the no. of settlements (maximum of 50). It is followed by a line containing K positive integers, where ith integer represents the cost of building SWAT station in the settlement i. This line is followed by a KxK matrix M, representing the channel layout. If M[i][j] is \'Y\', implies that there is a channel from settlement i to j, and \'N\' implies there is not.</p>\n<p>&nbsp;</p>\n<p>OUTPUT: T lines each printing the lowest average possible average cost (6 decimal places) of building SWAT stations in the given scenario case.</p>\n<p>&nbsp;</p>\n<p>EXAMPLE</p>\n<p>INPUT:</p>\n<p>3</p>\n<p>4</p>\n<p>5 6 7 8</p>\n<p>NYNN</p>\n<p>YNNN</p>\n<p>NNNY</p>\n<p>NNYN</p>\n<p>2</p>\n<p>10 5</p>\n<p>NY</p>\n<p>NN</p>\n<p>5</p>\n<p>34 22 25 43 12</p>\n<p>NYNNY</p>\n<p>YNNYN</p>\n<p>NNNYY</p>\n<p>NNNNN</p>\n<p>NNNNN</p>\n<p>&nbsp;</p>\n<p>OUTPUT:</p>\n<p>6.000000</p>\n<p>7.500000</p>\n<p>19.666667</p>\n<p>&nbsp;</p>',100,0,1000,4000,3000,50000,'C,C++,Python 2,Python 3,Java','diff','-bB'),(5,1,'Na','<p>s,dmf</p>',80,0,500,2000,1500,50000,'C,C++,Python 2,Python 3,Java','diff','-bB'),(6,1,'National Word','<p>When the open source world was taught about the English language, people got quite fascinated. Each of the country decided to use one particular word as its national word, which is made up of distinct letters. Each of the country also decided to make a national dictionary which consisted of the words which can be made by the letters present in the national word. However, this dictionary had some special feature. The various words in the dictionary were sorted first according to the size and then according to the alphabet. Tux and Droid were amongst the best coders in the open source world. The emperor of the Open Source hired the two coders to help each country in making their national dictionary.They were given the task to find the Rth word of the national dictionary for a given country which uses word W as its national word.</p>\n<p>&nbsp;</p>\n<p>Input :&nbsp;</p>\n<p>&nbsp;</p>\n<p>The first line will contain the number of test cases. T test cases follow:</p>\n<p>The first line of each test case will contain the length L of the word W</p>\n<p>The second line will contain the word W itself.</p>\n<p>The third line will contain the number R.</p>\n<p>&nbsp;</p>\n<p>Output :&nbsp;</p>\n<p>For each test case, you need to print the word with rank R in the alphabetical order.</p>\n<p>&nbsp;</p>\n<p>Constraints :&nbsp;</p>\n<p>&nbsp;</p>\n<p>5&lt;T&lt;10</p>\n<p>1&lt;=|W|&lt;=26</p>\n<p>0&lt;R&lt;1000000009</p>\n<p>&nbsp;</p>\n<p>Sample Test Case:</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Input :&nbsp;</p>\n<p>&nbsp;</p>\n<p>2</p>\n<p>5</p>\n<p>mukti</p>\n<p>3</p>\n<p>4</p>\n<p>code</p>\n<p>5</p>\n<p>&nbsp;</p>\n<p>Output :</p>\n<p>&nbsp;</p>\n<p>m</p>\n<p>cc</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>',80,0,500,2000,1500,50000,'C,C++,Python 2,Python 3','diff','-bB'),(6,2,'Master Thief','<p><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">You are a master theif. You have broken into the house of a rich banker. There are 2-16 rooms in the house (The first room is numbered 0). The last room contains a safe full of diamonds. You can move from any room to another provided it\'s gate is open. Now the problem is that the gate-switch of a room maybe present in any other room. Initially you are in the zeroeth room(the gate is unlocked) and all the other gates are closed. You need to get to the last room without leaving a trace, that is when you reach the final room all other gates must be closed.</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">A move is defined as traversing from one room to another. Since the police of seven countries is after you, the heist needs to be completed in minimum number of moves.</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">If the mission is impossible, you cry out \"HORRIBLE\".</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">Input:</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">First line contains integer T, the number of test cases. Each test case is made up of two lines, with first line containing integer N (number of rooms). Next line contains N space separated integers, each describing the location of switches. The ith integer is the room number having the switch for room i.</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">Output:</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">T lines, each containing the minimum number of moves required, or \"HORRIBLE\" in case the heist is impossible.</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">Example:</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">Input:</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">4</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">2</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">0 1</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">3</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">1 2 0</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">6</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">4 4 3 0 5 2</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">13</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">7 11 1 12 6 3 0 2 6 0 0 5 9</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">Output:</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">HORRIBLE</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">3</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">7</span><br style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\" /><span style=\"font-family: \'Courier New\', Courier, monospace; font-size: 14px;\">15</span></p>',100,0,1500,6000,4500,50000,'C,C++,Python 2,Python 3','diff','-bB'),(6,3,'Bots','<pre style=\"word-wrap: break-word; white-space: pre-wrap;\">                                                                     \n                                                                     \n                                                                     \n                                             \nRoboA and RoboB are math buddies. RoboA cuts a convex polygon with N sides into exactly K polygons. Cuts will only be made from vertex to vertex and each cut divides one polygon into exactly two polygons. Hence, RoboA will make exactly K-1 such cuts. RoboB is analyzing the polygons created by RoboA. He is not intelligent enough to distinguish between different polygons with same number of sides. RoboB is wondering how many different sets of K polygons he can get. Order of polygons created doesn&rsquo;t matter. Can u help him out?\n\nInput format:\nFirst line of input contains a single integer t which is the number of test cases to follow.Next line contains two integers N and K where n is no. of sides of the initial polygon and k is the total number of polygons obtained by cutting the initial polygon.\n\nOutput\nReturn the number of possible sets of K polygons. Since the number may be very large return the answer modulo (10^9 + 7).\n\nConstraints:\n\nt &lt;= 10000\n3 &lt;= N &lt;= 1000\n1 &lt;= K &lt;= 1000\n\nsample input:\n5\n5 1\n4 2\n6 3\n8 3\n7 7\n\nsample output:\n1\n1\n1\n3 \n0\n\nExplanation:\nConfigurations(test-case 1): (1 pentagon)\nConfigurations(test-case 2): (2 Triangles)\nConfigurations(test-case 3): (2 Triangles, 1 quadrilateral)\nConfigurations(test-case 4): (2 Triangles, 1 hexagon), (1 Triangles, 1 quadrilateral, 1 pentagon), (3 quadrilaterals)\nConfigurations(test-case 5): none (7 polygons cannot be cut from a polygon with 7 sides.)</pre>',120,0,2000,8000,6000,50000,'C,C++,Python 2,Python 3','diff','-bB');
