INSERT INTO `cc_settings` VALUES ('timezone','Asia/Kolkata'),('tester_path','/var/www/codecracker/tester'),('assignments_root','/var/www/codecracker/assignments'),('file_size_limit','50'),('output_size_limit','1024'),('queue_is_working','0'),('default_late_rule','/* \n * Put coefficient (from 100) in variable $coefficient.\n * You can use variables $extra_time and $delay.\n * $extra_time is the total extra time given to users\n * (in seconds) and $delay is number of seconds passed\n * from finish time (can be negative).\n *  In this example, $extra_time is 172800 (2 days):\n */\n\nif ($delay<=0)\n  // no delay\n  $coefficient = 100;\n\nelseif ($delay<=3600)\n  // delay less than 1 hour\n  $coefficient = ceil(100-((30*$delay)/3600));\n\nelseif ($delay<=86400)\n  // delay more than 1 hour and less than 1 day\n  $coefficient = 70;\n\nelseif (($delay-86400)<=3600)\n  // delay less than 1 hour in second day\n  $coefficient = ceil(70-((20*($delay-86400))/3600));\n\nelseif (($delay-86400)<=86400)\n  // delay more than 1 hour in second day\n  $coefficient = 50;\n\nelseif ($delay > $extra_time)\n  // too late\n  $coefficient = 0;'),('enable_easysandbox','1'),('enable_c_shield','0'),('enable_cpp_shield','0'),('enable_py2_shield','0'),('enable_py3_shield','1'),('enable_java_policy','1'),('enable_log','1'),('submit_penalty','300'),('enable_registration','1'),('registration_code','0'),('mail_from','codecracker@mkti.in'),('mail_from_name','CodeCracker GLUG'),('reset_password_mail','<p>\nSomeone requested a password reset for your Sharif Judge account at {SITE_URL}.\n</p>\n<p>\nTo change your password, visit this link:\n</p>\n<p>\n<a href=\"{RESET_LINK}\">Reset Password</a>\n</p>\n<p>\nThe link is valid for {VALID_TIME}. If you don\'t want to change your password, just ignore this email.\n</p>'),('add_user_mail','<p>\nHello! You are registered in Sharif Judge at {SITE_URL} as {ROLE}.\n</p>\n<p>\nYour username: {USERNAME}\n</p>\n<p>\nYour password: {PASSWORD}\n</p>\n<p>\nYou can log in at <a href=\"{LOGIN_URL}\">{LOGIN_URL}</a>\n</p>'),('moss_userid','912326600'),('results_per_page_all','40'),('results_per_page_final','80'),('week_start','0');
